const ApiCall = () => {
    const [Data, setData] = useState({})
    fetch("https://swapi.dev/api/people/1")
    .then(res => res.json())
    .then(data => setData(Data));
  return (
    <div>{JSON.stringify(Data, null, 2)}</div>
  )
}

export default ApiCall
